import React, { Component } from 'react';

import mail from '../../img/about/mail.png';
import github from '../../img/about/github.png';
import linkedin from '../../img/about/linkedin.png';
import soundcloud from '../../img/about/soundcloud.png';
import medium from '../../img/about/medium.png';

import '../../css/About.css';

class About extends Component {
  render() {
    return (
      <div className="About">
        <h1>About</h1>
        <p>
          My name is Jin Ai. I graduated from Yale with a degree in Art and I am a full stack web developer with experience in Ruby on Rails, React.js, and React-Redux.
        </p>

        <p>
          I like climbing, computer music, and cats.
        </p>

        <p>
          Technical skills: JavaScript, Ruby on Rails, React.js, React-Redux, HTML5, CSS, SQL, Adobe Creative Cloud
        </p>

        <h2>Contact</h2>

        <p className='icon-container'>
          <a href='mailto:jinai.jyap@gmail.com'><img src={mail}  className='icon' /></a>
          <a href='https://github.com/yapjinai'><img src={github}  className='icon' /></a>
          <a href='https://www.linkedin.com/in/yapjinai/'><img src={linkedin}  className='icon' /></a>
          <a href='https://soundcloud.com/jinai'><img src={soundcloud}  className='icon' /></a>
        </p>

        <h6>
          Icons by <a href="https://www.flaticon.com/authors/swifticons" title="Swifticons">Swifticons</a>.
        </h6>
      </div>
    );
  }
}

export default About;
